import React from "react";

interface CellInterface {
	children: React.ReactNode;
	width?: number;
}

const Cell = (props: CellInterface) => {
	return (
		<td
			style={{
				width: props.width ? `${(props.width * 100) / 12}%` : "auto",
			}}
		>
			{props.children}
		</td>
	);
};

export default Cell;
